{'title': "EQ in FL Studio | Klink als de pro's [FL Studio Tutorial]", 'description': 'EQ is een van de belangrijkste tools bij het mixen van een track. Een equalizer kun je vergelijken met een mengpaneel. Met de knoppen kun je onderdelen van een geluid zachter of juist harder maken. Zo klinken geluiden beter en zitten ze elkaar niet in de weg. 

Ontdek  in deze video hoe jij EQ gebruikt in FL Studio. En hoe je tracks steeds beter klinken met equalizen. 

Vind je dit interessant? Abonneer en bezoek ook mijn site DAWproducer.com.'}

